INSERT INTO `artikel` (`artikel_id`, `title`, `keyword`, `description`, `content`, `path`, `ka_id`, `tanggal`, `counter`, `user_id`) VALUES
(5, 'Roti Sharon Rasa Baru: Kismis Coklat', 'roti sharon', 'roti sharon dengan rasa baru yaitu kismis coklat', '<div style="text-align: justify; ">\n	Sharon Bakery adalah perusahaan yang bergerak dalam industri makanan. Perusahaan ini didirikan pada tahun 1988 di Jl. Rancajigang Majalaya, Kabupaten Bandung, Jawa Barat.&nbsp;<span style="text-align: justify; ">Pada tahun 2002, Sharon Bakery membuka cabang di Majalengka, dan dalam kurun waktu 10 tahun sesudahnya sudah membuka pabrik di Tegal, Manado, Makassar, Kediri, Banjarmasin, Banyuwangi, Lampung, Demak, Palembang, Bogor dan Bali. Pada tahun 2009, PT. MSRA membuka toko08 yang menjual produk-produk dengan brand Sharon Bakery &nbsp; &nbsp;yang bertempat di Hyper Square Jl. Pasir Kaliki Bandung. Sebagai produsen roti, PT Multi Star Rukun Abadi mempunyai kapasitas produksi s</span><span style="text-align: justify; ">ebesar 1.800 sak (45.000 kg) terigu per hari, dengan konsumen distributor roti, supermarket, toko eceran, pasar tradisional dan motoris. Adapun jenis produk yang dihasilkan adalah roti dan kue untuk konsumsi langsung.</span></div>\n<div style="text-align: justify; ">\n	Untuk dapat selalu memberikan kepuasan terhadap konsumen, PT Multi Star Rukun Abadi menerapkan ISO 9001: 2008 tentang Sistem Manajemen Mutu perusahaan. Dengan ini, perbaikan secara terus-menerus terhadap kinerja perusahaan dapat dilakukan, serta dapat menghasilkan produk yang &nbsp;bermutu dan higienis, sehingga layak dikonsumsi langsung oleh konsumen.&nbsp;PT Multi Star Rukun Abadi berorientasi kepada kepuasan konsumen dengan melakukan perbaikan terus menerus terhadap Sistem Manajemen Mutu perusahaan dan meningkatkan kualitas sumber daya manusia.</div>\n<div>\n	&nbsp;</div>\n', 'data/2436739550.jpg', 2, '2012-11-02 03:39:25', 51, 1);
INSERT INTO `beranda_item` (`beranda_id`, `title`, `desc`, `path`, `tanggal`, `user_id`) VALUES
(1, 'Welcome to Sharon Bakery', 'Roti Sharon hadir untuk Anda para pencinta roti. Dibuat dari resep klasik yang diolah menggunakan teknologi modern. Menciptakan roti dengan cita rasa yang khas.', 'data/1303949035.png', '2012-10-05 04:29:44', 1),
(2, 'Sharon Kitchen', 'Roti bisa jadi sajian sehat dan enak untuk keluarga. Makan roti jadi makin asyik dengan variasi menu olahan roti! Yuk, coba buat resepnya di dapur sendiri!', 'data/9221011772.jpg', '2012-10-23 04:26:58', 1),
(3, 'Sharon Product', 'Sharon Bakery menghasilkan produk yang bermutu dan higienis, sehingga layak dikonsumsi langsung oleh konsumen. When classic recipe meets modern technology.', 'data/3225918528.jpg', '2012-10-30 01:40:59', 1),
(4, 'Sharon Club', 'Daftarkan nama dan email Anda disini! Dapatkan informasi terbaru, artikel, promosi, diskon, produk baru, penawaran istimewa.', '', '2012-09-21 09:10:31', 1),
(5, 'Recipe of The Month', 'Kumpulan resep terpilih dari para netter kami! Yuk, contek dan praktekan di rumah Anda!', 'data/3982994039.jpg', '2012-10-30 01:41:26', 1),
(6, 'Tips & Tricks', 'Mau tahu rahasia tentang roti? Intip tips dan tricks-nya dan jadikan inspirasi untuk Anda!', 'data/321024181.jpg', '2012-10-30 01:41:48', 1),
(7, 'VISIT US AND TRY OUR BAKERY CAFE', 'Hyper Square Jl. Pasir Kaliki Bandung<br/>P : 022-952 56 999<br/>E : info@sharon.com', '', '2012-09-21 09:56:55', 1);
INSERT INTO `bread` (`bread_id`, `title`, `path`, `detail`, `tanggal`, `user_id`) VALUES
(1, 'Baguette', 'data/2855500243.jpg', '<p style="text-align: justify; ">\n	<strong>Roti&nbsp;</strong>ini dikenal juga sebagai French Bread. <strong>Roti</strong> tradisional asal Prancis ini memiliki kulit yang &nbsp;tebal, keras, berwarna kecoklatan, dengan rasa yang bersifat asam. Bentuknya panjang mirip tongkat. Anda bisa membuat garlic bread dengan roti ini sebagai pasangan dengan cream soup atau membuat bruschetta. Diameter standar dari Baguette adalah sekitar 5 atau 6 cm, panjangnya dapat mencapai 1 meter dan memiliki berat 250 gram. Baguette asli terbuat dari bahan &ndash; bahan yang tidak mengandung lemak dari adonan asam dan mempunyai banyak lubang atau pori-pori yang besar. Bagguette yang baik, ketika dipotong miring sesuai dengan alurnya, hanya meninggalkan remah yang sedikit.&nbsp;</p>\n', '2012-10-23 05:53:26', 1),
(2, 'Foccacia ', 'data/9471816141.jpg', '<p style="text-align: justify; ">\n	<strong>Roti tawar</strong> asal Italia ini seringkali diolah menjadi pizza dengan aneka topping. Dibuat dengan proses pemanggangan dan berbentuk oval atau kotak. Foccacia bisa dibuat dengan sangat tipis ataupun tebal, Foccacia tebal dapat langsung ditambahkan topping seperti bawang bombay, keju, rosemary, tomat, atau pun pepperoni. Di Italia, Foccacia merupakan camilan populer yang disantap begitu saja. Biasanya permukaannya diolesi dengan minyak zaitun, ditaburi irisan biji zaitun dan rempah &ndash; rempah daun yang beraroma sedap. Anda menyukai sandwich? Gunakan Foccacia untuk roti sandwich Anda.&nbsp;</p>\n', '2012-10-03 02:58:56', 1);
