INSERT INTO `history` (`history_id`, `title`, `path`, `detail`, `tanggal`, `user_id`) VALUES
(1, 'Last Image', 'data/416752649.jpg', '', '2012-09-26 08:10:52', 1),
(2, 'Roti: Sejarah Makanan Tertua di Dunia ', 'data/7827978138.jpg', '<p style="text-align: justify; ">\n	<span style="text-align: justify; "><strong>Roti </strong>yang biasa kita makan saat sarapan memiliki sejarah yang cukup panjang. &nbsp;Diawali beribu tahun yang lalu, ketika manusia hidup mengembara dan berburu, gandum ya</span><span style="text-align: justify; ">ng mereka temukan dikunyah begitu saja tanpa diolah. Lama kelamaan, mereka mengetahui cara lain untuk menikmatinya, ditumbuk dan dilumat bersama air sehingga membentuk pasta. Pasta yang dimasak diatas api kemudian mengeras dan lebih tahan lama. Ternyata<strong> roti</strong> memang salah satu makanan tertua di dunia!</span></p>\n<div>\n	&nbsp;</div>\n', '2012-10-23 05:34:19', 1),
(3, '', 'data/4554725345.jpeg', '<p style="text-align: justify; ">\n	<span style="text-align: justify; ">Asal muasal <strong>roti</strong> sebenarnya berasal dari bangsa Mesir Kuno. <strong>Roti</strong> masa itu belum seenak seperti <strong>roti&nbsp;</strong>yang biasa kita makan sekarang. Cara membuatnya pun masih primitif: tepung, air, dan adonan ragi dicampur lalu diinjak-injak oleh para budak. Dibakar dalam tungku kuno berbentuk kerucut. Masa itu para pekerja Mesir tidak diupah dengan uang, tetapi dengan <strong>roti</strong>. sering disebut breadwinner atau orang yang berjuang untuk mendapat <strong>roti</strong>. Kata<strong> &rsquo;roti&rsquo;</strong> sering dipakai untuk menggantikan kata &rsquo;rezeki&rsquo;.</span></p>\n<div>\n	&nbsp;</div>\n<div>\n	&nbsp;</div>\n', '2012-10-23 05:34:57', 1),
(4, '', 'data/6354010002.jpg', '<p style="text-align: justify; ">\n	Bangsa Yunani mengambil teknologi pembuatan<strong> roti </strong>dari Mesir. Teknologi ini kemudian menyebar di seluruh Eropa dan dianggap penting oleh masyarakatnya. Di Roma <strong>roti </strong>dan gandum lebih penting daripada daging. Pada zaman itu warna<strong> roti </strong>membedakan &lsquo;kelas&rsquo; dalam masyarakat. Semakin gelap warna<strong> roti</strong>, maka semakin rendah satus sosialnya. Ini dikarenakan tepung putih mahal. Tidak seperti sekarang, <strong>roti </strong>mudah dibeli dimana pun dan dapat dikonsumsi semua kalangan tanpa batas karena harganya sangat terjangkau.</p>\n', '2012-10-23 05:33:59', 1),
(5, '', 'data/7810280611.jpg', '<p style="text-align: justify; ">\n	Sampai saat ini,<strong> roti </strong>tradisional di Timur Tengah, India, dan Afrika masih berbentuk pipih. Teknik paling dasar membuat <strong>roti</strong> seperti ini masih digunakan dibeberapa negara walau perkembangan teknik dan jenis <strong>roti</strong> modern semakin beragam. Lihat saja Tortila Mexico, <strong>Roti</strong> Canai India, Pitabread di Timur Tengah dan lain-lain. Pada abad pertengahan, <strong>roti</strong> telah berevolusi, terutama di Benua Eropa. Cita rasa <strong>roti</strong> termasuk <strong>roti tawar</strong> sudah sama seperti yang kita temukan saat ini, tentu saja dengan bentuk dan variasinya.</p>\n', '2012-10-23 05:36:13', 1),
(6, 'Tahukah Anda?', 'data/5981180886.jpg', '<ul>\n	<li style="text-align: justify; ">\n		<span style="text-align: justify; ">Otto Frederick Rohwedder (1880-1960) dikenal sebagai penemu mesin otomatis pemotong/pengiris </span><strong style="text-align: justify; ">roti tawar</strong><span style="text-align: justify; ">. Rohwedder bekerja cukup lama untuk mesin penemuannya te</span><strong style="text-align: justify; ">r</strong><span style="text-align: justify; ">sebut, sampai akhirnya, pada 7 Juli 1928, Rohwedder mampu membuat sejarah pertama kalinya: <strong>roti</strong> diiris dan dibungkus oleh sebuah mesin.&nbsp;</span></li>\n	<li style="text-align: justify; ">\n		Bangsa Mesir Kuno tidak hanya hebat dalam bidang arsitektur seperti membangun bendungan besar atau monumen seperti piramida, mereka juga mampu menciptakan <strong>roti</strong> dan menemukan cara untuk membuat <strong>roti tawar</strong> lebih enak.</li>\n</ul>\n<div>\n	&nbsp;</div>\n', '2012-10-23 05:41:40', 1),
(8, '', 'data/2553491983.jpg', '', '2012-10-23 05:41:18', 1);
INSERT INTO `how` (`how_id`, `title`, `path`, `detail`, `tanggal`, `user_id`) VALUES
(1, 'Mengetahui Bahan Dasar Roti', 'data/7735015098.jpg', '<div style="text-align: justify; ">\n	Ketika mencoba membuat roti di rumah, akan ada banyak resep yang &ldquo;dicontek&rdquo; dan Anda akan &nbsp;menemukan beberapa bahan dasar yang terus menerus dipakai ketika Anda membuat roti. Bahan &ndash; bahan yang berbentuk cairan selalu digunakan dalam pembuatan roti. Namun takaran bahan &ndash; bahan ini dapat menciptakan rasa yang berbeda &ndash; beda jika Anda tidak konsisten dalam menakar. Berikut adalah bahan &ndash; bahan cair yang dapat membuat roti Anda seenak seperti di bakery.&nbsp;</div>\n<div style="text-align: justify; ">\n	&nbsp;</div>\n<ul>\n	<li style="text-align: justify; ">\n		Air, cairan utama yang digunakan untuk melarutkan ragi dan membentuk adonan roti&nbsp;</li>\n	<li style="text-align: justify; ">\n		Susu, digunakan untuk membuat kerak lembut, dan dapat digunakan sebagai pengganti air.</li>\n	<li style="text-align: justify; ">\n		Yogurt / Buttermilk, digunakan untuk menambah rasa (asam) untuk roti.</li>\n	<li style="text-align: justify; ">\n		Cairan lain yang mungkin digunakan ketika membuat roti adalah santan, bir, teh hijau, jus, dll...</li>\n</ul>\n<div style="text-align: justify; ">\n	&nbsp;</div>\n<div style="text-align: justify; ">\n	Kebanyakan bahan cairan yang digunakan dalam resep roti, selalu berada pada suhu kamar sebelum digunakan.&nbsp;</div>\n', '2012-10-05 05:59:55', 1);
