INSERT INTO `natural_item` (`natural_id`, `content`, `tanggal`, `user_id`) VALUES
(1, 'data/8039377820.jpg', '2012-10-16 05:02:49', 1),
(2, '<p>\n	&nbsp;</p>\n<div style="text-align: justify; ">\n	<strong>Ragi alami</strong> atau <strong>natural yeast</strong> telah dipakai Bangsa Mesir kuno sejak zaman dahulu kala. Ragi adalah bahan yang digunakan untuk mengembangkan roti. Untuk mempermudah pembuatan roti, maka ragi diproduksi secara massal, menghasilkan ragi instan yang dijual bebas. Produsen roti pun lebih memilih menggunakan ragi instan karena proses produksi relatif lebih mudah dan cepat.</div>\n<div style="text-align: justify; ">\n	&nbsp;</div>\n<div style="text-align: justify; ">\n	Tapi, Sharon Bakery memahami bahwa penggunaan<strong> ragi alami</strong> membuat roti memiliki rasa yang klasik.</div>\n<div style="text-align: justify; ">\n	&nbsp;</div>\n<div style="text-align: justify; ">\n	<strong>Ragi alami</strong> (saccharomyces cerevisiae) ini harus dipelihara dengan treatment khusus untuk menghasilkan roti yang terbaik. Metode yang mirip juga yang dipakai untuk memelihara biang yogurt sehingga menghasilkan yogurt yang terbaik.</div>\n<div style="text-align: justify; ">\n	&nbsp;</div>\n<div style="text-align: justify; ">\n	<strong>Ragi alami</strong>&nbsp;atau <strong>natural yeast</strong> ini juga mengubah glukosa menjadi asam yang menghambat pertumbuhan jamur. Karena itu roti yang menggunakan ragi alami akan lebih tahan lama dibandingkan dengan roti yang menggunakan ragi instan.</div>\n<div>\n	&nbsp;</div>\n', '2012-10-16 05:02:49', 1);
