INSERT INTO `page` (`page_id`, `title`, `text`, `tanggal`, `keyword`, `description`, `user_id`) VALUES
(1, 'Sharon Gallery', '<p>\n	<strong>Sharon Store</strong>: Cafe Nyaman untuk Nikmati Roti Lezat&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p style="text-align: justify; ">\n	<strong>Sharon Store</strong> adalah cafe yang menjual produk-produk dengan brand Sharon Bakery yang bertempat di Hyper Square Jl.Pasir Kaliki Bandung. Dengan tempat yang nyaman dan berada di pusat kota Bandung, <strong>Sharon Store</strong> mencoba untuk menjadi tempat hang out bagi siapapun. Di <strong>Sharon Store</strong> Anda dapat menikmati semua produk roti kami fresh from the oven. Buka pukul 7 pagi, Anda bisa sarapan di <strong>Sharon Store</strong> sambil menikmati beragam menu coffee kami.&nbsp;Jenuh untuk meeting di kantor? Cafe kami memiliki tempat yang luas dan nyaman untuk meeting bersama rekan kerja atau klien Anda. &nbsp;</p>\n', '2012-10-23 06:23:04', 'sharon store, cafe, resto', 'sharon store, cafe dan resto', 1),
(2, 'Sharon Story', '<div style="text-align: justify; ">\n	Sharon Bakery adalah perusahaan yang bergerak dalam industri makanan. Perusahaan ini didirikan pada tahun 1988 di Jl. Rancajigang Majalaya, Kabupaten Bandung, Jawa Barat.</div>\n<div style="text-align: justify; ">\n	&nbsp;</div>\n<div style="text-align: justify; ">\n	Pada tahun 2002, Sharon Bakery membuka cabang di Majalengka, dan dalam kurun waktu 10 tahun sesudahnya sudah membuka pabrik di Tegal, Manado, Makassar, Kediri, Banjarmasin, Banyuwangi, Lampung, Demak, Palembang, Bogor dan Bali. Pada tahun 2009, PT. Multi Star Rukun Abadi membuka toko08 yang menjual produk-produk dengan brand Sharon Bakery yang bertempat di Hyper Square Jl.Pasir Kaliki Bandung.</div>\n<div style="text-align: justify; ">\n	&nbsp;</div>\n<div style="text-align: justify; ">\n	Sebagai produsen roti, PT Multi Star Rukun Abadi mempunyai kapasitas produksi sebesar 1.80008 sak (45.000 kg) terigu per hari, dengan konsumen distributor roti, supermarket, toko eceran, pasar tradisional dan motoris. Adapun jenis produk yang dihasilkan adalah roti dan kue untuk konsumsi langsung.</div>\n<div style="text-align: justify; ">\n	&nbsp;</div>\n<div style="text-align: justify; ">\n	Untuk dapat selalu memberikan kepuasan terhadap konsumen, PT. Multi Star Rukun Abadi menerapkan ISO 9001: 2008 tentang Sistem Manajemen Mutu perusahaan. Dengan ini, perbaikan secara terus-menerus terhadap kinerja perusahaan dapat dilakukan, serta dapat menghasilkan produk yang &nbsp;bermutu dan higienis, sehingga layak dikonsumsi langsung oleh konsumen.</div>\n<div style="text-align: justify; ">\n	&nbsp;</div>\n<div style="text-align: justify; ">\n	PT. Multi Star Rukun Abadi&nbsp;berorientasi kepada kepuasan konsumen dengan melakukan perbaikan terus menerus terhadap Sistem Manajemen Mutu perusahaan dan meningkatkan kualitas sumber daya manusia.</div>\n<div>\n	&nbsp;</div>\n<div>\n	&nbsp;</div>\n<div>\n	&nbsp;</div>\n', '2012-10-01 09:23:53', 'Sharon story, story of sharon', 'Sharon story untuk description, yang akan muncul di meta tag description...', 1),
(3, 'Contact Us', 'contact us text', '2012-10-06 04:18:05', 'contact us, kontak kami', 'contact us kami disini untuk memberikan pertanyaan atau komentar mengenai produk Sharon Bakery', 1),
(4, 'Sharon Product', '<p>\n	Cras lorem turpis, pulvinar sodales malesuada id, porttitor sed neque. Sed porta arcu in quam vestibulum vitae malesuada tortor condimentum. Mauris faucibus tristique libero. Nam dignissim auctor est. Praesent ultricies sodales est, eu ultricies massa molestie id.</p>\n', '2012-10-23 06:37:01', 'produk sharon bakery', 'produk sharon bakery', 1),
(5, 'History of Bread', '<p>\n	ini text untuk history... hahaha, edisi revisi 25 September 2012... selesaikan semua kerjaan uda itu sante... hahaha</p>\n<p>\n	<img alt="" src="http://localhost/sharon/data/rockn_roll.jpg" style="width: 96px; height: 96px;" /></p>\n', '2012-10-23 05:36:58', 'roti, roti tawar', 'Roti dan roti tawar yang biasa kita makan saat sarapan memiliki sejarah yang cukup panjang.  Diawali beribu tahun yang lalu, ketika manusia hidup mengembara ', 1),
(6, 'Bread Types', '<p>\n	&nbsp;</p>\n<div>\n	<strong>Roti:</strong> Variasi Rasa Bentuk yang Beragam dari Berbagai Negara&nbsp;</div>\n<div>\n	&nbsp;</div>\n<div style="text-align: justify; ">\n	<strong>Roti </strong>&nbsp;memiliki berbagai jenis dan rasa. Walaupun kebanyakan diantaranya sebenarnya tawar, tapi ada sedikit sensasi rasa yang tercicip di lidah. Berikut diantaranya:</div>\n', '2012-10-23 05:54:50', 'roti, roti tawar', 'Roti: Variasi Rasa Bentuk Roti Tawar yang Beragam dari Berbagai Negara ', 1),
(7, 'Tips & Tricks', '<p>\n	ini text buat tips &amp; tricks... revisi 25 september 2012 internet lemot banget... :D</p>\n', '2012-10-01 08:34:17', 'tips & tricks\n', 'tips & tricks for baking, making bread', 1),
(8, 'How It Works', '<p>\n	text how it works...&nbsp; checked...</p>\n', '2012-10-03 03:04:07', 'how it works ', 'how it works, bahan makanan menjadi roti', 1),
(9, 'Recipes', '<p>\n	ini text untuk resep... salah hahaha</p>\n', '2012-10-03 07:59:40', 'recipe, resep kue', 'recipe bulanan dari Sharon Bakery, bagaimana resep kue dapat dipraktekan di rumah', 1),
(10, 'Recipe Of The Month', 'ini text recipes of the month...', '2012-10-03 08:00:33', 'recipe of the month', 'recipe of the month, resep bulanan yang dikirimkan oleh pembaca', 1),
