(13, 'Production Stage', '<p>\n	<b>Produksi roti SHARON BAKERY meliputi beberapa tahap :</b></p>\n<p>\n	1. Mixing</p>\n<p>\n	<img alt="" src="http://buatwebsite.biz/sharon/media/2.png" /></p>\n<p>\n	2. Forming</p>\n<p>\n	<img alt="" src="http://buatwebsite.biz/sharon/media/1.png" /></p>\n<p>\n	3. Steaming</p>\n<p>\n	<img alt="" src="http://buatwebsite.biz/sharon/media/1282112920_Smart.png" style="width: 128px; height: 128px;" /></p>\n<p>\n	4. Baking</p>\n<p>\n	<img alt="" src="http://buatwebsite.biz/sharon/media/1281582288_file-roller.png" style="width: 128px; height: 128px;" /></p>\n<p>\n	5. Cooling</p>\n<p>\n	<img alt="" src="http://buatwebsite.biz/sharon/media/1281582288_file-roller.png" style="width: 128px; height: 128px; " /></p>\n<p>\n	6. Packing and Labelling</p>\n<p>\n	<img alt="" src="http://buatwebsite.biz/sharon/media/1281582288_file-roller.png" style="width: 128px; height: 128px; " /></p>\n', '2012-11-02 02:48:20', 'production stage, proses produksi', 'production stage atau proses produksi dari roti sharon', 1),
