INSERT INTO `produk_item` (`pi_id`, `title`, `kategori_id`, `path`, `detail`, `tanggal`, `user_id`) VALUES
(21, 'Bagelen Roomboter Original', 3, 'data/4609973691.jpg', '<p style="text-align: justify; ">\n	Bagelen Kering Roomboter Original (oval) merupakan cemilan sehat untuk seluruh keluarga Anda. Resep klasik dari Sharon Bakery ini, dipadukan dengan teknologi modern sehingga menghasilkan penganan jenis bagelen renyah yang higienis. &nbsp;Rasa manis dari cream roomboter serta roti berbentuk oval yang dibuat garing, dapat menjadi peneman minum teh di segala suasana. &nbsp;Tersedia dalam bentuk dan rasa lainnya: Bagelen Kering Crispy Roomboter (bulat) dan Bagelen Kering Roomboter Cheese.</p>\n', '2012-10-29 05:58:50', 1),
(22, 'Crispy Roomboter', 3, 'data/5135036422.jpg', '<p>\n	Bagelen Kering Crispy Roomboter (bulat) merupakan cemilan sehat untuk seluruh keluarga Anda. Resep klasik dari Sharon Bakery ini, dipadukan dengan teknologi modern sehingga menghasilkan penganan jenis bagelen renyah yang higienis. &nbsp;Rasa manis dari cream roomboter serta roti yang dibuat garing, dapat menjadi peneman minum teh di segala suasana. &nbsp;Tersedia dalam bentuk dan rasa lainnya: Bagelen Kering Roomboter Original (oval) dan Bagelen Kering Roomboter Cheese.</p>\n', '2012-10-05 06:38:10', 1),
(23, 'Mini Roomboter Cheese', 2, 'data/6541832918.jpg', '<p style="text-align: justify; ">\n	&nbsp;Roti mini dengan rasa istimewa. Roti isi lapisan cream roomboter yang lembut, ditambah dengan lembaran keju gurih. Ragi alaminya menambah keistimewaan rasa dari bagelen mini Sharon Bakery ini. Sajikan Mini Roomboter Cheese sebagai menu pembuka di pesta Anda.&nbsp;</p>\n', '2012-10-29 06:06:29', 1),
(24, 'Roomboter Cheese isi 1', 2, 'data/9969856692.jpg', '<p style="text-align: justify; ">\n	Anda pencinta keju? Sharon Bakery melengkapi produk bagelennya dengan Bagelen Roomboter Cheese Isi 1, dengan kemasan yang lebih praktis, sekarang Anda dapat menikmati roti isi keju plus cream roomboter yang gurih. Kemasan higienis dan fresh, rasa yang enak dan berkulitas.&nbsp;</p>\n', '2012-10-05 06:39:46', 1),
(26, 'Roomboter Cheese', 2, 'data/7185535859.jpg', '<p style="text-align: justify; ">\n	Sekarang Anda bisa menikmati bagelen dengan berbagai rasa. Coba Bagelen Roomboter Cheese dari Sharon Bakery, roti bagelen dengan isi cream roomboter dan keju. Perpaduan rasa gurih dan asin dari cream roomboter dan keju-nya menghasilkan kombinasi rasa unik di lidah. Tersedia dalam rasa lainnya: Cream Messes dan Roomboter.</p>\n', '2012-10-29 06:25:07', 1),
(27, 'Mini Roomboter', 2, 'data/9897855543.jpg', '<p style="text-align: justify; ">\n	Nikmati kelezatan gurih dan manis-nya Bagelen roombooter Sharon Bakery dengan ukuran mini. Bagelen Mini Roomboter dapat menjadi teman Anda disaat &nbsp;sarapan, peneman minum teh ataupun cemilan saat bersantai bersama keluarga di rumah.</p>\n', '2012-10-29 06:29:28', 1),
(28, 'Roomboter', 2, 'data/3332051783.jpg', '<p style="text-align: justify; ">\n	Bagelen isi cream roomboter dengan kualitas istimewa dari Sharon Bakery. Rasanya yang gurih, manis dan lezat di lidah menjadikannya favorit para penikmat roti. Tersedia dalam rasa lainnya: Cream Messes dan Roomboter Cheese.</p>\n', '2012-10-29 06:30:38', 1),
(29, 'Mini Cream Messes', 2, 'data/2427403321.jpg', '<p style="text-align: justify; ">\n	Sarapan sekali gigit dengan double rasa. Cream lembut dan messes manis-nya, menjadikan Mini Cream Messes dari Sharon Bakery cocok untuk anak &ndash; anak Anda. Jadikan Bagelen berukuran mini ini sebagai bekal praktis di sekolah.</p>\n', '2012-10-29 06:36:03', 1),
(30, 'Cream Messes isi 1', 2, 'data/170727497.jpg', '<p style="text-align: justify; ">\n	Mau sarapan yang lebih praktis? Coba Cream Messes Isi 1 dari Sharon Bakery! Sekarang Anda bisa sarapan dimana pun dan kapan pun, lebih praktis dan cepat. Nikmati sarapan Roti Sharon enak dan sehat ini bersama dengan cream-nya yang lembut dan messes manis yang lezat. &nbsp;</p>\n', '2012-11-06 08:43:14', 1),
(31, 'Cream Messes', 2, 'data/9817391713.jpg', '<p style="text-align: justify; ">\n	Yuk, sarapan dengan Bagelen Cream Meses dari Sharon Bakery. Rotinya yang fresh, rasa asin dari cream-nya, serta manis dari coklat meses-nya akan membuat sarapan lebih kaya rasa dan sehat. Sajikan untuk seluruh keluarga Anda di pagi hari. Tersedia dalam rasa lainnya: Roomboter dan Roomboter Cheese</p>\n', '2012-10-29 06:49:07', 1),
(32, 'Bagelen Roomboter Cheese', 3, 'data/4541963320.jpg', '<p style="text-align: justify; ">\n	Bagelen Kering Roomboter Cheese (oval) merupakan cemilan sehat untuk seluruh keluarga Anda. Resep klasik dari Sharon Bakery ini, dipadukan dengan teknologi modern sehingga menghasilkan penganan jenis bagelen renyah yang higienis. &nbsp;Rasa manis dari cream roomboter ditambah topping keju, serta roti berbentuk oval yang dibuat garing, dapat menjadi peneman minum teh di segala suasana. &nbsp;Tersedia dalam bentuk dan rasa lainnya: Bagelen Kering Crispy Roomboter (bulat) dan Bagelen Kering Roomboter Original (oval).</p>\n', '2012-10-29 06:54:04', 1),
(33, 'Roti Sisir', 4, 'data/3043433236.jpg', '<p style="text-align: justify; ">\n	Roti Sisir yang diproduksi oleh Sharon Bakery merupakan salah satu jenis roti oles yang mungkin sudah tidak lagi menjadi tren di bidang usaha roti. Roti dengan bentuk dan rasa yang akan mengingatkan Anda pada masa kanak &ndash; kanak ini, telah dikemas dengan lebih modern dan tentu saja higienis. Dapatkan segera Roti Sisir dari Sharon Bakery dengan olesan melted creamnya yang menggiurkan.</p>\n', '2012-10-29 06:54:57', 1),
(34, 'Sobek Coklat', 4, 'data/6976199238.jpg', '<p style="text-align: justify; ">\n	Roti Sobek yang diproduksi oleh Sharon Bakery merupakan salah satu jenis roti manis yang mungkin jarang diproduksi lagi oleh perusahaan roti modern. Roti manisnya yang lembut dilengkapi dengan coklat melted, menghasilkan kombinasi rasa manis yang pas. Tersedia dalam rasa lainnya: Roti Sobek Coklat Keju.</p>\n', '2012-10-05 06:38:32', 1),
(35, 'Sobek Coklat Keju', 4, 'data/def.png', '<p style="text-align: justify; ">\n	Roti Sobek yang diproduksi oleh Sharon Bakery merupakan salah satu jenis roti manis yang mungkin jarang diproduksi lagi oleh perusahaan roti modern. Roti manisnya yang lembut dilengkapi dengan coklat melted dan keju gurih, menghasilkan kombinasi rasa manis dan asin yang pas. Tersedia dalam rasa lainnya: Roti Sobek Coklat.</p>\n', '2012-10-05 06:39:03', 1),
(36, 'Roti Tawar Panjang', 5, 'data/3927549663.jpg', '<div style="text-align: justify; ">\n	Roti Tawar Panjang dari Sharon Bakery dibuat dari bahan &ndash; bahan alami, rasanya tawar, karena dalam proses pembuatannya tanpa dicampuri bahan lain. Roti Tawar Panjang berbentuk persegi ini, berwarna putih dan cokelat pada bagian tepinya. &nbsp;Roti Tawar Panjang Sharon Bakery dapat disantap sebagai menu sarapan bersama margarin, messes, aneka selai atau irisan daging, telur, dan bahan makanan lainnya.</div>\n<div>\n	&nbsp;</div>\n', '2012-10-29 06:57:34', 1),
(37, 'Roti Tawar Bundar', 5, 'data/5197625285.jpg', '<p style="text-align: justify; ">\n	Roti Tawar Panjang (bulat) dari Sharon Bakery dibuat dari bahan &ndash; bahan alami, rasanya tawar, karena dalam proses pembuatannya tanpa dicampuri bahan lain. Roti Tawar Panjang berbentuk bulat ini, berwarna putih dan cokelat pada bagian tepinya. &nbsp;Roti Tawar Panjang (bulat) Sharon Bakery dapat disantap sebagai menu sarapan bersama margarin, messes, aneka selai atau irisan daging, telur, dan bahan makanan lainnya.&nbsp;</p>\n', '2012-10-29 06:58:00', 1),
(38, 'Roti Tawar Kupas', 5, 'data/3805814920.jpg', '<div>\n	Roti Tawar Kupas dari Sharon Bakery dibuat dari bahan &ndash; bahan alami, rasanya tawar, karena dalam proses pembuatannya tanpa dicampuri bahan lain. Roti Tawar Panjang berbentuk persegi ini, berwarna putih dan tanpa kulit (kupas). &nbsp;Roti Tawar Kupas Sharon Bakery ini lebih lembut dan dapat disantap sebagai menu sarapan bersama margarin, messes, aneka selai atau irisan daging, telur, dan bahan makanan lainnya.</div>\n<div>\n	&nbsp;</div>\n', '2012-10-29 06:58:22', 1),
(39, 'Paroti - Sharon', 6, 'data/def.png', '<p>\n	Dapatkan Paroti - Sharon Bread, di seluruh gerai Alfamart seluruh Jawa Barat</p>\n', '2012-11-02 02:53:52', 1),
(40, 'Indomaret', 7, 'data/1410038727.jpg', '<p>\n	Dapatkan di seluruh gerai Indomaret seluruh Jawa Barat</p>\n', '2012-11-06 08:42:50', 1);
