INSERT INTO `resep_otm` (`resep_otm_id`, `nama`, `fpath`, `kota`, `title`, `path`, `detail`, `cara`, `bulan`, `tahun`, `tanggal`, `user_id`) VALUES
(1, 'Zuka', 'data/6497343471.jpg', 'Bandung', 'Zuka Recipes', 'data/7628989689.jpg', '<p>\n	Bahan :</p>\n<p>\n	1. Roti Perusahaan<br />\n	2. Selai Emas<br />\n	3. Dark Chocolate<br />\n	4. Kolostrum Milk</p>\n<p>\n	&nbsp;</p>\n', '<p>\n	Cara Membuat :<br />\n	1. Potong dadu roti.<br />\n	2. Campur dengan kolostrum milk, aduk rata.<br />\n	3. Cairkan dark chocolate, lalu campurkan dengan roti yang tadi.<br />\n	4. Tuang 1/3 campuran tadi ke cetakan, lalu tambahkan selai.<br />\n	5. Tambahkan sisa campuran dan ulangi langkah ke empat sampai campuran habis.</p>\n', 8, 2012, '2012-10-03 08:02:00', 1),
(3, 'Agus', 'data/1720575299.jpg', 'Medan', 'Special Pie', 'data/602594218.jpg', '<p>\n	Special pie dibuat dengan berjuta rasa cinta didalamnya :D</p>\n<p>\n	Bahan :<br />\n	1. Sejuta Cinta<br />\n	2. Pie</p>\n', '<p>\n	Campurkan pie dengan sejuta cinta... jadilah pie special.... :D</p>\n', 7, 2011, '2012-10-03 08:01:25', 1),
(4, 'Just Iron Man', 'data/1017959583.jpg', 'New York', 'Burning Iron Man', 'data/1389371515.jpg', '<p>\n	Burning iron man...</p>\n', '<p>\n	just shoot iron man with lava rocket... mwahaha</p>\n', 0, 2012, '2012-10-06 05:45:41', 1);
