INSERT INTO `tips` (`tips_id`, `title`, `path`, `detail`, `tanggal`, `user_id`) VALUES
(2, 'Resep untuk Pemula', 'data/2703988268.jpg', '<p>\n	Punya resep membuat roti dan berminat untuk membuat di rumah? Sebagai pemula, resep adalah panduan utama Anda. Perhatikan resep yang Anda miliki, selalu timbang setiap bahan dengan tepat sesuai resep.</p>\n', '2012-10-03 03:01:00', 1),
(3, 'Simpan Tepung dengan Benar', 'data/1332211387.jpg', '<p style="text-align: justify; ">\n	Terlalu banyak membeli tepung? Jangan buang tepung yang tersisa. Agar tidak rusak, ada cara menyimpan sisa tepung dengan benar. Masukkan tepung dalam kaleng yang kering dan bersih serta tertutup rapat. Bila Anda ingin menambahkan tepung yang baru, lebih baik jangan dicampurkan, tetapi habiskan dulu tepung yang lama.</p>\n', '2012-10-03 03:02:33', 1),
(5, 'Isi Coklat untuk Roti', 'data/7078708023.jpg', '<p style="text-align: justify; ">\n	Bagi Anda penggemar coklat, makan roti menggunakan coklat sudah pasti jadi sesuatu yang wajib. Coba tambahkan filling coklat berbentuk selai saat menikmati bagelen dari Sharon Bakery. Setelah itu coba panggang dan nikmati saat masih hangat.&nbsp;</p>\n', '2012-10-24 07:15:29', 1);
